// ==UserScript==
// @name         Enable Paste
// @description  Prevent websites from blocking paste and other events like right click, select all, etc. The website is allowed to do whatever it wants but if the same command is continually blocked then the website will be prevented from blocking it further.
// @namespace    https://github.com/laverdet
// @version      2025-08-25
// @author       marcel
// @match        *://*/*
// @downloadURL  https://raw.githubusercontent.com/laverdet/userscripts/refs/heads/main/dist/paste.user.js
// @updateURL    https://raw.githubusercontent.com/laverdet/userscripts/refs/heads/main/dist/paste.user.js
// @grant        none
// ==/UserScript==

type Listener = (event: Event) => void;
type Filter = (listener: Listener, options: AddEventListenerOptions) => void;

// eslint-disable-next-line @typescript-eslint/no-meaningless-void-operator
void function() {
	// eslint-disable-next-line strict
	"use strict";

	const playSound = function() {
		const data = "data:audio/mp3;base64,";
		let element: HTMLAudioElement | null;
		return () => {
			element ??= new Audio(data);
			void element.play();
		};
	}();

	// If the you repeat a cancelled event within this time frame then the page will no longer be
	// allowed to cancel it.
	const kTimeout = 1000;

	// Pass events where a keyboard modifier key is pressed.
	const filterModifierKey = (listener: Listener) => (event: KeyboardEvent) => {
		if (event.altKey || event.ctrlKey || event.metaKey) {
			listener(event);
		}
	};

	// Pass right click mouse events.
	const filterRightClick = (listener: Listener) => (event: MouseEvent) => {
		if (event.button === 2) {
			listener(event);
		}
	};

	// Brief list of events that the internet cannot be trusted with.
	const events: readonly Filter[][] = [
		[ (listener, options) => document.addEventListener("copy", listener, options) ],
		[ (listener, options) => document.addEventListener("cut", listener, options) ],
		[ (listener, options) => document.addEventListener("paste", listener, options) ],
		[
			(listener, options) => document.addEventListener("click", filterRightClick(listener), options),
			(listener, options) => document.addEventListener("mousedown", filterRightClick(listener), options),
			(listener, options) => document.addEventListener("mouseup", filterRightClick(listener), options),
		],
		[
			(listener, options) => document.addEventListener("keydown", filterModifierKey(listener), options),
			(listener, options) => document.addEventListener("keypress", filterModifierKey(listener), options),
			(listener, options) => document.addEventListener("keyup", filterModifierKey(listener), options),
		],
	];

	for (const eventGroup of events) {
		let forceDefault = false;

		for (const add of eventGroup) {
			let propogated = true;
			let time = 0;
			// Event capture phase
			add(
				event => {
					if (!propogated && event.timeStamp - time < kTimeout) {
						if (!forceDefault) {
							playSound();
						}
						forceDefault = true;
					}
					if (forceDefault) {
						event.stopImmediatePropagation();
					} else {
						propogated = false;
						time = event.timeStamp;
					}
				},
				{ capture: true },
			);
			// Event bubble phase. If this isn't called then the event was cancelled.
			add(
				event => {
					if (!event.defaultPrevented) {
						propogated = true;
					}
				},
				{ capture: false },
			);
		}
	}
}();
